import React from 'react';

// Import SVG components - matching actual filenames in src/assets/icons
import { ReactComponent as IcAP } from '../assets/icons/ap.svg';
import { ReactComponent as IcGovernment } from '../assets/icons/government.svg';
import { ReactComponent as IcPublic } from '../assets/icons/public.svg';
import { ReactComponent as IcInitiative } from '../assets/icons/initiative.svg';
import { ReactComponent as IcTrap } from '../assets/icons/trap.svg';
import { ReactComponent as IcInfluence } from '../assets/icons/influence.svg';
import { ReactComponent as IcRound } from '../assets/icons/round.svg';
import { ReactComponent as IcBuff } from '../assets/icons/buff.svg';
import { ReactComponent as IcDraw } from '../assets/icons/draw.svg';
import { ReactComponent as IcDiscard } from '../assets/icons/discard.svg';
import { ReactComponent as IcReturn } from '../assets/icons/return.svg';
import { ReactComponent as IcDeactivate } from '../assets/icons/deactivate.svg';
import { ReactComponent as IcCancel } from '../assets/icons/cancel.svg';
import { ReactComponent as IcShield } from '../assets/icons/shield.svg';
import { ReactComponent as IcAura } from '../assets/icons/aura.svg';
import { ReactComponent as IcScience } from '../assets/icons/science.svg';
import { ReactComponent as IcHealth } from '../assets/icons/health.svg';
import { ReactComponent as IcMilitaryPenalty } from '../assets/icons/military_penalty.svg';
import { ReactComponent as IcRegisterTrap } from '../assets/icons/register_trap.svg';
import { ReactComponent as IcInitiativeActivated } from '../assets/icons/initiative_activated.svg';
import { ReactComponent as IcStartOfTurn } from '../assets/icons/start_of_turn.svg';
import { ReactComponent as IcCopy } from '../assets/icons/copy.svg';
import { ReactComponent as IcClear } from '../assets/icons/clear.svg';
import { ReactComponent as IcSearch } from '../assets/icons/search.svg';
import { ReactComponent as IcMoney } from '../assets/icons/money.svg';
import { ReactComponent as IcLog } from '../assets/icons/log.svg';

// Fallback component
const noop = () => null;

const ICONS: Record<string, React.FC<React.SVGProps<SVGSVGElement>>> = {
  // Core game icons
  ap: IcAP,
  government: IcGovernment,
  public: IcPublic,
  initiative: IcInitiative,
  trap: IcTrap,
  influence: IcInfluence,
  round: IcRound,
  buff: IcBuff,
  draw: IcDraw,
  discard: IcDiscard,
  return: IcReturn,
  deactivate: IcDeactivate,
  cancel: IcCancel,
  shield: IcShield,
  aura: IcAura,
  science: IcScience,
  health: IcHealth,
  military_penalty: IcMilitaryPenalty,
  register_trap: IcRegisterTrap,
  initiative_activated: IcInitiativeActivated,
  start_of_turn: IcStartOfTurn,
  copy: IcCopy,
  clear: IcClear,
  search: IcSearch,
  money: IcMoney,
  log: IcLog,
};

export type IconName = keyof typeof ICONS;

export function Icon({
  name,
  size = 16,
  className,
  title,
  ...rest
}: {
  name: IconName;
  size?: number;
  className?: string;
  title?: string;
} & React.SVGProps<SVGSVGElement>) {
  const Cmp = ICONS[name] || (noop as any);
  return <Cmp width={size} height={size} aria-label={title || name} className={className} {...rest} />;
}
